        public struct GameplayActions
        {
            private @GameInput m_Wrapper;
            public GameplayActions(@GameInput wrapper) { m_Wrapper = wrapper; }
            public InputAction @Gameplay_Move => m_Wrapper.m_Gameplay_Gameplay_Move;
            public InputAction @Gameplay_Interact => m_Wrapper.m_Gameplay_Gameplay_Interact;
            public InputAction @Gameplay_Attack => m_Wrapper.m_Gameplay_Gameplay_Attack;
            public InputAction @Gameplay_Pause => m_Wrapper.m_Gameplay_Gameplay_Pause;
            public InputAction @Gameplay_HotBarNavigate => m_Wrapper.m_Gameplay_Gameplay_HotBarNavigate;
            public InputAction @Gameplay_Dodge => m_Wrapper.m_Gameplay_Gameplay_Dodge;
            public InputAction @Gameplay_NorthAction => m_Wrapper.m_Gameplay_Gameplay_NorthAction;
            public InputAction @Gameplay_LeftTrigger => m_Wrapper.m_Gameplay_Gameplay_LeftTrigger;
            public InputAction @DEBUG_ACTION_1 => m_Wrapper.m_Gameplay_DEBUG_ACTION_1;
            public InputAction @DEBUG_ACTION_2 => m_Wrapper.m_Gameplay_DEBUG_ACTION_2;
            public InputAction @DEBUG_ACTION_3 => m_Wrapper.m_Gameplay_DEBUG_ACTION_3;
            public InputAction @DEBUG_ACTION_4 => m_Wrapper.m_Gameplay_DEBUG_ACTION_4;
            public InputActionMap Get() { return m_Wrapper.m_Gameplay; }
            public void Enable() { Get().Enable(); }
            public void Disable() { Get().Disable(); }
            public bool enabled => Get().enabled;
            public static implicit operator InputActionMap(GameplayActions set) { return set.Get(); }
            public void AddCallbacks(IGameplayActions instance)
            {
                if (instance == null || m_Wrapper.m_GameplayActionsCallbackInterfaces.Contains(instance)) return;
                m_Wrapper.m_GameplayActionsCallbackInterfaces.Add(instance);
                @Gameplay_Move.started += instance.OnGameplay_Move;
                @Gameplay_Move.performed += instance.OnGameplay_Move;
                @Gameplay_Move.canceled += instance.OnGameplay_Move;
                @Gameplay_Interact.started += instance.OnGameplay_Interact;
                @Gameplay_Interact.performed += instance.OnGameplay_Interact;
                @Gameplay_Interact.canceled += instance.OnGameplay_Interact;
                @Gameplay_Attack.started += instance.OnGameplay_Attack;
                @Gameplay_Attack.performed += instance.OnGameplay_Attack;
                @Gameplay_Attack.canceled += instance.OnGameplay_Attack;
